INSERT INTO `bear_content` VALUES ('0000000005', '<p style=\"text-align: center;\"><strong><span style=\"font-family:Microsoft YaHei;\"><span style=\"font-size:28px;\">常用兑换地址</span></span></strong></p><p style=\"text-align: center;\">&nbsp;</p><p style=\"text-align: center;\">&nbsp;</p><p>腾讯视频兑换地址：<a href=\"http://film.qq.com/duihuan.html\" target=\"_blank\">http://film.qq.com/duihuan.html</a></p><p>爱奇艺充值地址：<a href=\"http://vip.iqiyi.com/jihuoma.html\" target=\"_blank\">http://vip.iqiyi.com/jihuoma.html</a></p><p>优酷手机浏览器激活地址：<a href=\"http://m.vip.youku.com/index.php?c=index&a=pay\" target=\"_blank\">http://m.vip.youku.com/index.php?c=index&amp;a=pay</a></p><p>优酷电脑官方激活地址：<a href=\"http://vip.youku.com/?c=account&a=card\" target=\"_blank\">http://vip.youku.com/?c=account&amp;a=card</a></p><p>PPTV激活网址：<a href=\"http://pay.vip.pptv.com/v2/ppcard\" target=\"_blank\">http://pay.vip.pptv.com/v2/ppcard</a></p><p>芒果激活地址：<a href=\"http://i.mgtv.com/vip/exchange/page\" target=\"_blank\">http://i.mgtv.com/vip/exchange/page</a></p><p>搜狐激活地址：<a href=\"http://film.sohu.com/vip.html\" target=\"_blank\">http://film.sohu.com/vip.html</a></p><p>乐视激活地址：<a href=\"http://zhifu.le.com/exchange\" target=\"_blank\">http://zhifu.le.com/exchange</a></p><p>&nbsp;腾讯体育会员充值地址：<a href=\"http://sports.qq.com/kbsweb/mycenter.htm#vip\" target=\"_blank\">http://sports.qq.com/kbsweb/mycenter.htm#vip</a></p>');
INSERT INTO `bear_content` VALUES ('0000000020', '<p style=\"text-align: center;\"><span style=\"font-size:28px;\"><span style=\"font-family:Microsoft YaHei;\"><strong>关于栗子发卡网</strong></span></span></p><p>&nbsp;</p><p>&nbsp;</p><p><span style=\"font-size:14px;\">栗子发卡网（www.036ka.com）是爱逗云网络工作室旗下拳头品牌,</span>致力于数字产品自动发卡平台程序的研发，我们坚持做最简单最好用的个人发卡平台程序。让您在最短的时间内就可以上手并建成一个属于自己的自动发卡平台！</p><p>&nbsp;</p><p><span style=\"font-size:14px;\">我们承诺将秉承“客户至上”的经营理念，关注好每一个细节，不断完善用户体验，优化安全机制，努力提升服务质量。</span></p><p>&nbsp;</p><p><span style=\"font-size:14px;\">我们相信，在每位职员的努力下，开创性的虚拟交易时代即将来临。</span></p>');
INSERT INTO `bear_content` VALUES ('0000000021', '<p style=\"text-align: center;\"><span style=\"font-family:Microsoft YaHei;\"><span style=\"font-size:28px;\"><strong>栗子发卡网帮助中心</strong></span></span></p><p style=\"text-align: center;\">&nbsp;</p><p style=\"text-align: center;\">&nbsp;</p><p>如何购买卡密：</p><p>第一步：先注册 一个账号 或者登陆</p><p>第二步：选购指定商品 确认够买</p><p>第三步：充值结算</p><p>第四步：完成 提取卡密</p><p>如有疑问请联系客服处理</p><p><br/></p>');
